import axios from "axios"
import { post, get, upload } from "src/request/api"

// 在售列表
export const saleList = (data = {}) => {
 return post('/api/v1/app/sale/sale-list', data)
}
// 在售列表
export const receive = (data = {}) => {
 return post('/api/v1/app/sale/ack-sale-item-receive', data)
}
// 在售项未已收到款
export const notReceive = (data = {}) => {
 return post('/api/v1/app/sale/ack-sale-item-not-receive', data)
}

// 代售列表
export const saleBankCard = (data = {}) => {
 return post('/api/v1/app/sale/get-sale-bank-card', data)
}
// 开始代售
export const saleBankCardStart = (data = {}) => {
 return post('/api/v1/app/sale/sale-bank-card/start', data)
}
// 停止代售
export const saleBankCardStop = (data = {}) => {
 return post('/api/v1/app/sale/sale-bank-card/idle', data)
}
